export default function Home(props) {
    return (
        <div>
            <Header />
            <nav>
                <NavLink to='/'>Movie Info</NavLink> {' | '}
                <NavLink to='/cart'>Movie Poster</NavLink>
            </nav>

        </div>
    )

}
